            </div>
            <p className="profile__subtitle" />
          </div>
        </div>
        <button className="profile__add" type="button" onClick={handleAddPlaceClick}>
          <img src={AddPhoto} />
        </button>
      </div>
    </section>
    <section className="elements"></section>
  </main>

  );
}

export default Main;
